Many attribute the 4th dimension to time (as do I only with many other examples), and this idea reveals that the 3rd dimension is just an illusion within the higher 4th dimension.
As we follow this pattern of dimensional foundational illusions an existential notion presents itself.
If this pattern of illusions continues throughout all dimensions then the highest dimension is the only truth. I attribute the highest dimension to light and consciousness, since we need these to perceive any dimension at all. The pattern we have followed is suggesting that all dimensions (and therefore realities) are just an illusion of light and consciousness. 
It is all about perspective...
